import React from "react";

const NavBar = () => (
  // create a vertical nav bar
  <div className="not-fancy-font fixed left-10 bottom-0 flex flex-col justify-between text-white text-20">
    <div className="flex flex-col gap-10">
      <div className="flex flex-col gap-5">
        <div className="text-16">About me</div>
      </div>
      <div className="flex flex-col gap-5">
        <div className="text-16">Projects</div>
      </div>
      <div className="flex flex-col gap-5">
        <div className="text-16">Software Engineer/ Artist</div>
      </div>
    </div>
  </div>
);

export default NavBar;
